contracts/learn_flow/main.sol.content:
// File: Main.sol
pragma solidity 0.5.1;
import "./variables.sol";
import "./enums.sol";
import "./defaultValues.sol";
import "./payable.sol";
import "./getSet.sol";
import "./mytoken.sol";
import "./uselibraries.sol";

/**
 * @title Main
 * Combines all the contracts to showcase their usage.
 */
contract Main {
    // Example contracts initialized for demonstration
    Variables public variables = new Variables();
    Enums public enums = new Enums();
    DefaultValues public defaults = new DefaultValues();
    Payable public payableContract;
    GetSet public getSet = new GetSet();
    MyToken public myToken;
    UsingLibraries public usingLibraries = new UsingLibraries();

    constructor(address payable _wallet, string memory _name, string memory _symbol) public {
        payableContract = new Payable(_wallet);
        myToken = new MyToken(_name, _symbol);
    }
}

contracts/learn_flow/uselibraries.sol.content:
// File: UsingLibraries.sol
pragma solidity 0.5.1;
import "./math.sol";

/**
 * @title UsingLibraries
 * Demonstrates the use of a library in Solidity.
 */
contract UsingLibraries {
    uint256 public value;

    function calculate(uint256 _value1, uint256 _value2) public {
        value = Math.divide(_value1, _value2);
    }
}

contracts/learn_flow/mytoken.sol.content:
// File: MyToken.sol
pragma solidity 0.5.1;
import "./erc20token.sol";

/**
 * @title MyToken
 * Inherits from ERC20Token and adds custom functionality.
 */
contract MyToken is ERC20Token {
    string public symbol;
    address[] public owners;
    uint256 public ownerCount;

    constructor(string memory _name, string memory _symbol) ERC20Token(_name) public {
        symbol = _symbol;
    }

    function mint() public {
        super.mint();
        ownerCount++;
        owners.push(msg.sender);
    }
}

contracts/learn_flow/getSet.sol.content:
// File: GetSet.sol
pragma solidity 0.5.1;

/**
 * @title GetSet
 * Demonstrates getter and setter functions.
 */
contract GetSet {
    string public value;

    function get() public view returns (string memory) {
        return value;
    }

    function set(string memory _value) public {
        value = _value;
    }
}

contracts/learn_flow/payable.sol.content:
// File: Payable.sol
pragma solidity 0.5.1;

/**
 * @title Payable
 * Demonstrates payable functions and buying tokens.
 */
contract Payable {
    mapping(address => uint256) public balances; // Track token balances
    address payable public wallet; // Wallet to receive Ether

    constructor(address payable _wallet) public {
        wallet = _wallet; // Initialize wallet
    }

    function buyToken() public payable {
        balances[msg.sender] += 1; // Increment token balance
        wallet.transfer(msg.value); // Transfer Ether to wallet
    }
}

contracts/learn_flow/defaultValues.sol.content:
// File: DefaultValues.sol
pragma solidity 0.5.1;

/**
 * @title DefaultValues
 * Demonstrates setting default values in constructors.
 */
contract DefaultValues {
    string public value;

    constructor() public {
        value = "myValue"; // Set a default value
    }
}

contracts/learn_flow/enums.sol.content:
// File: Enums.sol
pragma solidity 0.5.1;

/**
 * @title Enums
 * Demonstrates usage of enums in Solidity.
 */
contract Enums {
    enum State { Waiting, Sleepy, Active } // Define possible states
    State public state;

    constructor() public {
        state = State.Waiting; // Set default state
    }

    function activate() public {
        state = State.Active;
    }

    function deactivate() public {
        state = State.Sleepy;
    }

    function isActive() public view returns (bool) {
        return state == State.Active;
    }

    function isSleepy() public view returns (bool) {
        return state == State.Sleepy;
    }
}

contracts/learn_flow/variables.sol.content:
// SPDX-License-Identifier: MIT

// File: Variables.sol
pragma solidity 0.5.1;

/**
 * @title Variables
 * Demonstrates different types of variables in Solidity.
 */
contract Variables {
    string public value = "myValue"; // String variable
    bool public isValid = true;      // Boolean variable
    int public myId = -1;           // Signed integer
    uint public myUint = 1;         // Unsigned integer
    uint8 public myByte = 8;        // Unsigned 8-bit integer
}

contracts/learn_flow/math.sol.content:
// File: Math.sol
pragma solidity 0.5.1;

/**
 * @title Math
 * Library for basic mathematical operations.
 */
library Math {
    function divide(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b > 0, "Cannot divide by zero");
        return a / b;
    }
}

contracts/learn_flow/erc20token.sol.content:
// File: ERC20Token.sol
pragma solidity 0.5.1;

/**
 * @title ERC20Token
 * Basic implementation of an ERC20-like token.
 */
contract ERC20Token {
    string public name;
    mapping(address => uint256) public balances;

    constructor(string memory _name) public {
        name = _name;
    }

    function mint() public {
        balances[tx.origin]++; // Increment balance for transaction originator
    }
}

